import { Actor, HttpAgent } from '@dfinity/agent';
import { idlFactory as hopechain_engine_idl } from '../declarations/hopechain_engine/ho';

const agent = new HttpAgent({ host: "http://127.0.0.1:4943" });
agent.fetchRootKey(); // Necessary for local development

const hopechain_engine_id = "asrmz-lmaaa-aaaaa-qaaeq-cai";

const hopechain_backend = Actor.createActor(hopechain_engine_idl, {
  agent,
  canisterId: hopechain_engine_id,
});

export default hopechain_engine;
